      this.$axios.get('getUser', {
        params: {
          account: this.user.account
        }
      }).then(res => {
        this.userMsg = res.data;
      }).catch(err => {
        console.log(err);
      });
    },

    submit() {
      this.$axios.put('editUser', this.userMsg).then(res => {
        if (res) {
          this.$message({
            message: '修改成功',
            type: 'success',
            duration: 1000
          });
        } else {
          this.$message({
            message: '修改失败',
